import React, { useState, useEffect } from 'react';
import { Grid, Image, List, Divider, Segment, Url, Header, Rating, Button, Icon } from 'semantic-ui-react'
import ReactPlayer from 'react-player'

const _SearchMovieListDisplay = (props) => {

    return (
        <React.Fragment>
            <center className="customImageDisplay">
                <Image onClick={() => props.movieDetials(props.movie.id)} src={props.movieImage} className="sizeOfNewSearchMovie" />
            </center>
        </React.Fragment >
    )
}

export default _SearchMovieListDisplay;
